import React, { Component } from "react";
import Photo from "./Photo";
import axios from "axios";

class Gallery extends Component {
	constructor(props) {
		super(props);
		this.state = {
			image: this.getData(),
			title: "",
		};
		this.state.image = this.state.image.bind(this);
	}

	getData() {
		axios
			.get("https://api.harvardartmuseums.org/image?apikey=221b4e10-7bc5-11ea-8865-8f439f2941d8")
			.then((res) => res.data)
			.then((data) => this.setState({ image: data.records }));
	}

	render() {
		console.log(this.state.image);
		return this.state.image.map((i) => {
			return (
				<div>
					<Photo url={this.state.image[i].baseimageurl} />
				</div>
			);
		});
	}
}

export default Gallery;
